【商品説明】<BR>●ネズミの嫌がるニオイを配合！ハッカ・琉球ハーブ（月桃）・ワサビなどの天然ハーブやネコのニオイなど、ネズミが嫌がる成分とニオイを配合したゲルタイプの忌避剤です。<BR>●置くだけで効果を発揮！台所の隅・倉庫・物置・屋根裏などに、置くだけで簡単にネズミを追い出し寄せ付けません。<BR>●殺鼠剤ではありません。<BR>●死骸の後処理は一切不要です。天然由来の成分を使用しているので、安心して使用できます。使用条件により異なりますが、効果は約2ヵ月で、6～8畳に1個の割合で使用ください。<BR><BR>商品サイズ：92×103×92<BR><BR>効能・効果：ネズミの侵入防止、ネズミによる被害の防止<BR><BR>成分：【成分】天然ハッカ油、天然ワサビオイル、天然琉球ハーブ（月桃）エキス、香料<BR><BR>ご使用上の注意等：・用途以外に使用しないでください。 <BR>・本品は食べられません。誤って口に入れたときは、水でよくすすいでください。皮膚についた場合は、石けんを用いてよく洗ってください。万一、異常がある場合は医師に相談してください。 <BR>・本品はネズミが嫌う臭いを主成分としていますが、臭いに慣れたネズミや感受性の乏しいネズミには効果が出にくい場合があります。 <BR>・薬剤によってアレルギー症状やかぶれ等を起こしやすい体質の人は使用しないでください。 <BR>・子供の手の届くところに置かないでください。 <BR>・中身を取り出したりしないでください。 <BR>・ペットや家畜のいる場所では使用しないでください。 <BR>・有機溶剤に弱いプラスチック類の近くでは使用しないでください。<BR><BR>・直射日光を避け、なるべく冷所で子供の手の届かないところに保管してください。 ・捨てる時は、そのまま不燃ゴミとして捨ててください。<BR><BR>原産国：中国<BR><BR>問い合わせ先：アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<BR>商品区分：ネズミ<BR>JANコード：4901080253910<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
