【商品説明】<br>●有効成分ジフェチアロールを配合！1度食べれば効くので、警戒心の強いネズミでもしっかり駆除<br>●ワルファリン等は、3～5日連続して食べさせることが必要ですが、ジフェチアロールは、ひとくち（一度）食べれば、優れた効果を示します。<br>●食べたネズミは内出血をおこし、数日かけて徐々に死に至りますので、他のネズミに警戒心を抱かせません。<br>●トレータイプ<br>●シールをはがしてそのまま置ける防水トレー入りなので、濡れたところや汚れたところにも置けます。<br>●抵抗性の強いスーパーラットにもしっかり<br><br>商品サイズ：146×176×38<br><br>効能・効果：ネズミの駆除<br><br>成分：【有効成分】ジフェチアロール【その他成分】小麦粉、トウモロコシデンプン、安息香酸デナトニウム、赤色102号、青色1号、赤色227号、他5成分<br><br>ご使用上の注意等：してはいけないこと<br>● 人や動物にも有害ですので、乳幼児・小児やペットなどが容易に近づける場所で使用しないでください。<br>● 食品、食器、飼料などに本品の薬剤が付着しないように注意してください。<br>● 皮膚や衣類などに本品の薬剤が付着しないよう注意してください。<br>● 魚に対する毒性もありますので、本品の薬剤を湖沼、河川及び池などに流さないでください。<br>相談すること<br>● 万一誤って食べた場合は、なるべく吐き出させ、医師の診療を受けてください。<br>● ペットなどが誤食した場合にも、直ちに獣医師の診療を受けてください。<br>● 医師、獣医師の診療を受ける際には、本品が抗血液凝固作用のあるクマリン系のジフェチアロールを含有することを告げてください。治療剤としては、ビタミンK1が有効です。<br>その他の注意<br>● 定められた用法用量を守ってください。<br>● 本品の薬剤に直接触れないでください。万一、皮膚に薬剤がついた場合は、石けんを用いて水でよく洗ってください。<br>● 土間、台所などの人が往来する場所に設置する場合は、就寝前に設置し、翌朝回収してください。<br>● 本品設置後は、何日も放置せず、数日経過後も食べない場合は、回収又は場所を移動してください。<br><br>● 食品、食器、飼料などと区別して保管してください。 ● 湿気を避け、乳幼児・小児の手の届かないところに保管してください。 ● 使用後残った本品についても、乳幼児・小児、動物（ペットなど）が触れないように注意して廃棄してください。 ● 使用後残った本品（薬剤部分）は可燃物として、容器部分は自治体の指示に従って廃棄してください。 ●人体に使用しないこと。<br><br>原産国：日本<br><br>問い合わせ先：アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<br><br>区分：防除用医薬部外品<br>JANコード：4901080053411<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
