【商品説明】<BR>●一撃で長年住みついたネズミも退散。アースレッドシステムを使用しているので、ネズミが嫌がる天然ハーブ（ハッカ油・琉球ハーブ）と煙の成分が、隠れたネズミにまでしっかり届いて、ネズミはびっくり退散します。<BR>●殺鼠剤ではありません。殺鼠剤を用いず、水を使って成分を拡散させるので、安心・安全です。<BR>●ネズミの被害にあった住まいはもちろん、倉庫・屋根裏・通路・廊下など簡単に処理し、速効効果に懲りたネズミがすみかに戻ってくるのを防ぎます。<BR><BR>商品サイズ：87×101×87<BR><BR>効能・効果：ネズミの忌避・侵入防止、ネズミによる被害の防止<BR><BR>成分：【成分】天然ハッカ油、天然琉球ハーブ（月桃）エキス、香料<BR><BR>ご使用上の注意等：・用途以外に使用しないでください。 <BR>・アルミ袋を開封後は、すぐに使用してください。（開封状態で長時間放置すると、吸湿して蒸散しないことがあります。） <BR>・薬剤処理中は立ち入らないようにしてください。 <BR>・本品は食べられません。誤って口に入れたときは、水でよくすすいでください。 <BR>・薬剤が皮膚、目など人体にかからないようにしてください。薬剤が皮膚についた場合は、石けんを用いてよく洗ってください。また、目に入った場合は、直ちに水でよく洗い流してください。万一、異常がある場合は医師に相談してください。 <BR>・火災報知器が作動することがあります。火災報知器の直下では使用せず、一時的にポリ袋などで覆いをして使用してください。その際、火気の管理には十分注意し、処理後は必ず覆いを取り除いてください。 <BR>・小鳥などのペット類、観賞植物は換気するまで部屋の外に出してください。また、観賞魚はエアーポンプを止めて完全密閉（水槽に覆いをして、ガムテープなどで密閉する）にして使用するか、換気するまで部屋の外に出してください。 <BR>・はがね製品、銅やシンチュウ製のものは変色することがあるので、覆いをするか部屋の外に出してください。 <BR>・故障の原因となるので、パソコン、ワープロ、ゲーム機器、オーディオ・ビデオ製品などの精密機器にはカバーをかけ、テープ、ディスクなどは箱に収納してください。（大型コンピューターのある部屋では使用しないでください。） <BR>・飲食物、食器、子供のおもちゃ、飼料、美術品、仏壇仏具などに薬剤がかからないようにしてください。 <BR>・ 薬剤缶は水に浸すとすぐに熱くなるので、直接手で触れないでください。ヤケドをする恐れがあります。 <BR>・ 煙を吸い込まないようにしてください。万一煙を吸い込んで気分が悪くなった場合は、通気のいいところで安静にしてください。気分が回復しない場合は、医師の診療を受けてください。 <BR>・品はネズミが嫌う臭いを主成分としていますが、臭いに慣れたネズミや感受性の乏しいネズミには効果が出にくい場合があります。 <BR>・ アレルギー症状やかぶれ等を起こしやすい体質の人は使用に注意してください。 <BR>・水は付属の水袋を用いて、必ず薬剤缶を入れる前にプラスチック容器に入れてください。プラスチック容器は、平らな場所を選び転倒しないように設置してください。 <BR>・薬剤缶の中身を取り出したりしないでください。 <BR>・ペットや家畜のいる場所では使用しないでください。<BR><BR>・湿気を避け、なるべく冷所で子供の手の届かないところに保管してください。 ・使用後の缶は不燃物として廃棄してください。<BR><BR>原産国：日本<BR><BR>問い合わせ先：アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<BR>商品区分：ネズミ<BR>JANコード：4901080254016<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
